import React, { useState, useEffect } from 'react';

function Home(){
    useEffect(()=>{
        fetch("/logout",{
            method: 'DELET',
            headers: { 'Content-Type': 'application/json' },
        }).then(resp => resp.json())
      },[])
    return (
        <p>Logged Out</p>
    )
}

export default Home;
